import Note from "./Note";

const NotesList = (props) => {
  console.log(props.notes);
  return (
    <div className="grid-container">
      {props.notes.map((note) => {
        return <Note text={props.notes.text} date={props.notes.time} />;
      })}
    </div>
  );
};

export default NotesList;
